export type WeatherDisplay = {
  date: string;
  temp: number;
  icon: string;
  description: string;
  alerts?: any;
};

export type ForecastDisplay = {
  time: string;
  temp: string;
  icon: string;
  main: string;
  alerts?: any;
};

export type WeatherData = {
  [key: string]: {
    weather: WeatherDisplay;
    forecast: ForecastDisplay[];
  };
};
